      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 * - col1 * - ( col2 ) + + col0 NOT BETWEEN ( - + col2 ) AND + 71 * - 94;
  - name: tab1

outputs:
